";s:30:"garage-door-motor-does-not-run";s:5:"title";s:51:"15 Reasons Why Your Garage Door Won T Open Or Close";s:3:"alt";s:21:"marvin s garage doors";s:3:"url";s:102:"https://marvinsgaragedoors.com/content/uploads/2018/03/15-Reasons-Your-Garage-Door-Wont-Open_v1-01.png";s:5:"thumb";s:123:"https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcR-xpyaFZxoBUN0SkvIz1H35h8-8nrqQsL2SkG8l783dDtzTOYBFkCoe08E7IunLZlT44k";s:8:"filetype";s:3:"png";s:5:"width";i:2254;s:6:"height";i:824;s:6:"source";s:78:"https://marvinsgaragedoors.com/2018/03/05/reasons-garage-door-wont-open-close/";s:6:"domain";s:22:"marvinsgaragedoors.com";}i:20;a:11:{s:7:"keyword";s:30:"garage door motor does not run";s:4:"slug";s:30:"garage-door-motor-does-not-run";s:5:"title";s:53:"Replace The Starter Capacitor On A Garage Door Opener";s:3:"alt";s:19:"veteran garage door";s:3:"url";s:86:"https://veterangaragedoor.com/wp-content/uploads/2015/04/garage-door-capacitor.jpg.jpg";s:5:"thumb";s:90:"https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSNLj08cKwRQndZikw-DCowhUquqgIyfuKmQw";s:8:"filetype";s:3:"jpg";s:5:"width";i:801;s:6:"height";i:1087;s:6:"source";s:95:"https://veterangaragedoor.com/faq/can-i-replace-the-starter-capacitor-on-a-garage-door-opener_/";s:6:"domain";s:21:"veterangaragedoor.com";}}s:9:"sentences";a:60:{i:0;s:110:"When you open your garage door and the motor wont stop running there might be a problem with the limit switch.";i:1;s:130:"This problem can be very annoying because it makes a lot of noiseThe limit switch is the one that controls the travel of the door.";i:2;s:71:"It tells the motor that lowers and lifts the door when to stop running.";i:3;s:91:"The other possible problem is your garage door could be failing to engage with your opener.";i:4;s:59:"How to Tell if The Motor Inside the Door Opener is Damaged.";i:5;s:176:"If the motor inside your garage door opener sounds like it is turning but the belt chain or screw is not moving you may have a broken or defective part inside the motor itself.";i:6;s:54:"Garage Door Opener Motor Not Working Repair - YouTube.";i:7;s:59:"Detach the opener by pulling the emergency handle downward.";i:8;s:62:"The next step is to attempt to open your garage door manually.";i:9;s:79:"This will determine if the issue is connected to the door itself or the opener.";i:10;s:71:"If you are able to raise your garage door easily it is not the problem.";i:11;s:69:"This indicates that something in the opener system has malfunctioned.";i:12;s:108:"If you have a dent use a block of wood against it and use a hammer against the wood to hammer that dent out.";i:13;s:95:"If the motor is running on your garage door opener but the door itself isnt opening dont panic.";i:14;s:36:"Theres usually a simple explanation.";i:15;s:130:"Most garage doors have an emergency release -- typically a red pull cord -- that allows the door to be opened and closed manually.";i:16;s:63:"When the cord is pulled the motor is disengaged from the chain.";i:17;s:47:"The motor will run but will not move the chain.";i:18;s:138:"It is not safe to operate your garage door opener with the sensors disabled or mounted anywhere other than the bottom corners of the door.";i:19;s:235:"That being said the best way to determine if the sensors are the issue or the wiring itself is to remove the sensors from their mounting brackets and wire them directly into the motor head to confirm that the sensors function normally.";i:20;s:97:"A visitor slid the vacation latch into the track so the next time the door was opened it couldnt.";i:21;s:80:"Eventually I discovered the engaged latch but now the motor will not run at all.";i:22;s:42:"It is a Genie Pro Stealth model GPS1200IC.";i:23;s:51:"12 years old but only opened about 20 times a year.";i:24;s:41:"The optical sensors are working properly.";i:25;s:53:"The door moves freely when disengaged from the chain.";i:26;s:22:"We do not use remotes.";i:27;s:33:"The wall button causes the motor.";i:28;s:59:"Get shopping advice from experts friends and the community.";i:29;s:107:"When we push the open button the motor runs and makes sound by the chain that opens the door does not move.";i:30;s:135:"When the garage door opener doesnt work operate properly check the alignment of the motor unit andor the rail and realign if necessary.";i:31;s:116:"If necessary adjust the settings for travel limits and force limits following the instructions in the owners manual.";i:32;s:71:"Make sure that the photoelectric eyes of the safety sensor are aligned.";i:33;s:125:"When the weather gets hot the metal on the bracket and rails expands in a way such that the safety sensors become misaligned.";i:34;s:102:"When its hot and the door doesnt operate check to see if there are any blinking lights on the sensors.";i:35;s:39:"If lights are blinking the sensors are.";i:36;s:90:"If the motor doesnt run at all you may need to replace the garage door opener logic board.";i:37;s:76:"Although rare a failed drive motor is another reason why the door wont open.";i:38;s:101:"If the motor buzzes and doesnt move an unobstructed and disconnected trolley replace the drive motor.";i:39;s:39:"Garage door opener motor keeps running.";i:40;s:101:"I have an older opener and wanted to adjust the height so I could get a few more inches of clearance.";i:41;s:45:"There were 2 adjustment knobs open and close.";i:42;s:91:"When the door was in the open position I turned the open knob and it moved up a few inches.";i:43;s:52:"Then closed the door and it didnt close all the way.";i:44;s:80:"There is 2 different reasons that I know of that will cause this malfunctioning.";i:45;s:45:"The most common reason is a worn out coupler.";i:46;s:200:"The coupler is a small round piece of plastic that connects the opener motor to the screw contained inside the rail that spins and moves the trolley forward and back to open and close the garage door.";i:47;s:30:"First get the door to go down.";i:48;s:76:"Then there is an adjustment on the motor head called the travel adjustments.";i:49;s:40:"These are on the side of the motor head.";i:50;s:107:"There is one for how far the opener goes down down travel and one for how far the opener goes up up travel.";i:51;s:56:"The Door May Not Be Connected to the Garage Door Opener.";i:52;s:64:"You may see the rack along the inside of the rail of the opener.";i:53;s:55:"Ensure the door is connected to the garage door opener.";i:54;s:55:"Use the emergency release handle to reconnect the door.";i:55;s:87:"See How To Disconnect The Garage Door Opener To Manually Open Or Close The Garage Door.";i:56;s:27:"Hums Longer Than 5 Seconds.";i:57;s:102:"This counterbalance is on even manual garage doors as without it the door would be impossible to open.";i:58;s:33:"How does the electric motor work.";i:59;s:100:"The motor actually doesnt do much of the work all it does is turn an arm that extends along a track.";}}